import React from 'react';
import './styles.css';
import ProjectCard from '../components/project-cards';
import Reddit0 from '../assets/reddit0.png';
import Reddit1 from '../assets/reddit1.png';
import Reddit2 from '../assets/reddit2.png';

import Sygeplej0 from '../assets/sygeplej0.png';
import Sygeplej1 from '../assets/sygeplej1.png';
import Sygeplej2 from '../assets/sygeplej2.png';

import Physiology0 from '../assets/physiology0.png';
import Physiology1 from '../assets/physiology1.png';
import Physiology2 from '../assets/physiology2.png';

import Pexels0 from '../assets/pexels0.png';
import Pexels1 from '../assets/pexels1.png';
import Pexels2 from '../assets/pexels2.png';

export default function Projects() {
    const reddit = [Reddit0, Reddit1, Reddit2];
    const sygeplej = [Sygeplej0, Sygeplej1, Sygeplej2];
    const physiology = [Physiology0, Physiology1, Physiology2];
    const pexels = [Pexels0, Pexels1, Pexels2];
    const greens = [Greens0, Greens1];

    return (
        <div className="Body">
            <h1>Projects</h1>

            <ProjectCard images={reddit} title="Speed for Reddit" />
            <ProjectCard images={pexels} title="Pexels wallpapers" />
            <ProjectCard images={sygeplej} title="Sygeplejersken" />
            <ProjectCard images={physiology} title="Physiology Calculator" />
        </div>
    )
}
